"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[246534],{246534:i=>{i.exports=JSON.parse('{"seo":{"title":"Servizi facchinaggio a Positano","description":"Contatti, tariffe e come prenotare facchini autorizzati per spostare bagagli su scale ripide."},"linkLabel":"Servizi facchinaggio a Positano","intro":["I facchini aiutano con bagagli pesanti o esigenze di mobilit\xe0. Organizza il ritiro al molo o alla fermata bus, conferma prima la tariffa e tieni con te gli oggetti di valore."],"sections":[{"id":"how","title":"Come funziona di solito","body":["Definisci punto e orario di incontro (molo o fermata bus). Comunica il nome dell\'alloggio e l\'orario.","Concorda il costo prima di iniziare. I prezzi variano per distanza, scale e fascia oraria.","Tieni con te i valori; etichetta bene le valigie."]},{"id":"resources","title":"Prenotazioni e risorse","body":["Chiedi al tuo alloggio fornitori locali affidabili vicino al molo e alle principali fermate bus.","Per deposito o opzioni fuori orario, vedi piattaforme come Bounce / Radical Storage."]},{"id":"etiquette","title":"Buone pratiche e consigli","body":["Lascia una mancia per servizio eccezionale o carichi pesanti; porta contanti di piccolo taglio.","Condividi in anticipo il piano di arrivo nei periodi di punta per assicurarti un posto."]}],"faqs":[{"q":"Ho bisogno dei facchini?","a":["Consigliato se hai bagagli pesanti; la citt\xe0 ha molte scale e vicoli ripidi."]},{"q":"Dove posso prenotare?","a":["Chiedi al tuo alloggio o ai servizi locali vicino alla spiaggia principale e alle fermate bus."]},{"q":"Quanto costa?","a":["Varia per distanza e carico; conferma la tariffa prima dell\'inizio del servizio."]}],"galleryTitle":"Galleria fotografica","gallery":{"standsCaption":"Postazioni facchini (esempio)","cartsCaption":"Carrelli dei facchini"}}')}}]);